import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';
import './App.css';
import Auth from './screens/Auth';


function App() {
  return (
    <Router>
      <Routes>
      <Route  path="/" element={Auth}/>
      </Routes>

    </Router>
  );
}

export default App;
